    were erroneously deposited into the Committee's Federal Account.  The the contributions
    were to the Oklahoma County Republican Party.  On that same day, the amounts were
    paid to the Oklahoma County Republican Party.   For reporting purposes, neither
    the Deposit or the Disbursement has been included on this report.  The total amount
    of the Deposit and the Disbursement is $135.00.   The 5/20/08 amended report is
    submitted because of an amended report filed for 5/20/07.  All intervening reports
    were opened.  This report has no changes.  Line 11 col A & col B do not equal.
    The difference is $3.19, attempts to correct the problem with the E-File division
    of the FEC were not effective. The correct balance is $17,105.93."
